import { Link } from 'react-router-dom';
import { useNavigate } from "react-router-dom";

const Hamburgernavbar = ({ user, onLogout }) => {
    const navigate = useNavigate();
    return (
        <div>
            <nav className="flex flex-col absolute right-[2%] items-center bg-white z-50 font-bold">
                <ul className="md:gap-10 lg:gap-12 lg:justify-end">
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/Contact">Contact</Link></li>
                    <li><Link to="/Blog">Blog</Link></li>
                    <li><Link to="/Services">Services</Link></li>
                    <li><Link to="/About">About</Link></li>
                </ul>
                {/* Auth Buttons */}
                <div className="justify-center gap-4 sm:gap-6 sm:text-md lg:gap-10">
                    <li><Link to="/Login">Login</Link></li>
                    <li><Link to="/Signup">Signup</Link></li>
                    <button
                        className="hover:text-yellow-300 hover:underline active:text-red-500"
                        onClick={() => onLogout && onLogout(null, navigate)}
                    >
                        Logout
                    </button>
                </div>
            </nav>
        </div>
    );
};
